//Componente Funcional ou STATELESS
const CInstancias = (props) => {

return <Fragment ><div className="Instancias"><p >Instancia: {props.nome} <br />    
             Status: {props.status} 
             <br />
             <button class="button" onClick={props.click} color="info">
                     On/Off
            </button></p>
             </div></Fragment>

}
export default CInstancias;
